import React from "react";
import { storiesOf } from "@storybook/react";
import Icon from "./index";

const onClose = (e: React.MouseEvent<HTMLButtonElement>) => {
  console.log(e, "===>");
};

const DefaultIcon = () => {
  return (
    <>
      <Icon theme="info" />
    </>
  );
};

storiesOf("Icon", module).add("icon Description", DefaultIcon);
